import React, { useState } from 'react';
import {
  Container,
  TextField,
  Button,
  Typography,
  Box,
  CircularProgress,
  Paper,
  ToggleButtonGroup,
  ToggleButton,
  Card,
  CardContent,
  Chip,
  List,
  ListItem,
  ListItemText,
  Divider,
  Stack,
  LinearProgress,
  Grid,
  Fade,
} from '@mui/material';
import CVForm from './components/CVForm';
import JobRanking from './components/JobRanking';
import CvImprovements from './components/CvImprovements';
import { ReactComponent as Logo } from './logo.svg';

const mockJobs = [
  {
    company_name: "Acme Corp",
    job_title: "Frontend Developer",
    match_rate: 87,
    match_breakdown: [
      "Candidate has 2+ years of experience using React at XYZ Ltd",
      "Has previously worked in a remote team environment",
      "Familiar with REST APIs, matching job's integration requirements"
    ],
    missing_requirements: [
      "No experience with GraphQL",
      "Limited exposure to TypeScript"
    ],
    recommendations: [
      "Take an introductory course on GraphQL",
      "Mention any TypeScript projects in resume, if applicable"
    ],
    summary: "Strong fit for the Frontend Developer role. The candidate has relevant experience with React and remote collaboration but should brush up on GraphQL to strengthen the application."
  },
  {
    company_name: "Beta Technologies",
    job_title: "Junior Backend Engineer",
    match_rate: 72,
    match_breakdown: [
      "Knowledge of Node.js aligns with backend requirements",
      "Built multiple personal projects using MongoDB"
    ],
    missing_requirements: [
      "No commercial experience with Docker",
      "Unclear understanding of CI/CD pipelines"
    ],
    recommendations: [
      "Include GitHub link showing Dockerized projects",
      "Add coursework or self-study of CI/CD tools like Jenkins"
    ],
    summary: "Moderate fit. The candidate shows backend potential but needs to demonstrate readiness for production workflows. Worth applying with minor adjustments to resume."
  }
];

const mockCvImprovements = {
  missing_sections: ["Certifications", "Languages"],
  weak_points: [
    "No detail on technical tools used in work experience",
    "Education lacks graduation date"
  ],
  recommendations: [
    "Add a Certifications section with any completed online courses or diplomas",
    "Include a list of spoken languages and proficiency levels",
    "Expand work experience with tools, technologies, and responsibilities"
  ],
  summary: "The resume shows potential but lacks important sections and detail. Adding measurable accomplishments and structure will greatly improve its strength."
};

function App() {
  const [result, setResult] = useState(null);
  const [error, setError] = useState(null);
  // TODO: Replace mock data with real data from result when backend is ready
  const jobs = mockJobs;
  const cvImprovements = mockCvImprovements;

  return (
    <Box
      sx={{
        minHeight: '100vh',
        width: '100vw',
        background: 'linear-gradient(135deg, #e0e7ff 0%, #f0fdfa 100%)',
        py: { xs: 2, md: 6 },
        px: 0,
        fontFamily: 'Inter, Segoe UI, Arial, sans-serif',
        position: 'relative',
        overflowX: 'hidden',
      }}
    >
      <Box
        sx={{
          position: 'relative',
          width: '100%',
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          zIndex: 2,
        }}
      >
        <Paper
          sx={{
            p: { xs: 2, sm: 4 },
            borderRadius: 5,
            boxShadow: '0 8px 32px 0 rgba(31, 38, 135, 0.18)',
            backdropFilter: 'blur(12px)',
            background: 'rgba(255,255,255,0.7)',
            border: '1px solid rgba(255,255,255,0.3)',
            maxWidth: 480,
            width: '100%',
            mt: 2,
            mb: 0,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            position: 'absolute',
            left: '50%',
            top: 0,
            transform: 'translate(-50%, 0)',
            zIndex: 10,
          }}
        >
          <Box sx={{ mb: 2, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
            <Logo style={{ width: 56, height: 56, marginBottom: 8, filter: 'drop-shadow(0 2px 8px #a5b4fc)' }} />
          </Box>
          <CVForm onResult={setResult} onError={setError} />
          {error && (
            <Typography color="error" sx={{ mt: 2 }}>
              {error}
            </Typography>
          )}
        </Paper>
      </Box>
      <Fade in={!!result} timeout={700}>
        <Box sx={{ width: '100%', pt: { xs: 18, sm: 20, md: 22 }, zIndex: 1, position: 'relative' }}>
          {result && (
            <Grid container spacing={4} alignItems="stretch" justifyContent="center">
              <Grid item xs={12} md={6}>
                <Paper
                  sx={{
                    p: { xs: 2, sm: 3 },
                    height: '100%',
                    boxShadow: '0 8px 32px 0 rgba(31, 38, 135, 0.18)',
                    borderRadius: 5,
                    backdropFilter: 'blur(10px)',
                    background: 'rgba(255,255,255,0.8)',
                    border: '1px solid rgba(255,255,255,0.3)',
                    transition: 'transform 0.2s, box-shadow 0.2s',
                    '&:hover': {
                      transform: 'translateY(-4px) scale(1.02)',
                      boxShadow: '0 16px 40px 0 rgba(31, 38, 135, 0.22)',
                    },
                  }}
                >
                  <JobRanking jobs={jobs} />
                </Paper>
              </Grid>
              <Grid item md={0.1} sx={{ display: { xs: 'none', md: 'flex' }, justifyContent: 'center', alignItems: 'stretch' }}>
                <Divider orientation="vertical" flexItem sx={{ mx: 0.5 }} />
              </Grid>
              <Grid item xs={12} md={6}>
                <Paper
                  sx={{
                    p: { xs: 2, sm: 3 },
                    height: '100%',
                    boxShadow: '0 8px 32px 0 rgba(31, 38, 135, 0.18)',
                    borderRadius: 5,
                    backdropFilter: 'blur(10px)',
                    background: 'rgba(255,255,255,0.8)',
                    border: '1px solid rgba(255,255,255,0.3)',
                    transition: 'transform 0.2s, box-shadow 0.2s',
                    '&:hover': {
                      transform: 'translateY(-4px) scale(1.02)',
                      boxShadow: '0 16px 40px 0 rgba(31, 38, 135, 0.22)',
                    },
                  }}
                >
                  <CvImprovements improvements={cvImprovements} />
                </Paper>
              </Grid>
            </Grid>
          )}
        </Box>
      </Fade>
    </Box>
  );
}

export default App;
